           v_idpes_cad, -- idpes_cad
           v_idsis_cad, -- idsis_cad 
           CURRENT_TIMESTAMP, -- data_cad
           'I' -- operacao
          );
  RETURN 0;
END;$_$
    LANGUAGE plpgsql;


